import {
  fromHex,
  toHex,
  SpendingValidator
} from 'lucid-cardano';
import { decode, encode } from 'cbor-x'
import { Responses } from "@blockfrost/blockfrost-js"
import {Integer} from "asn1js";

const aadaValidator = (validatorName: String): SpendingValidator => {
  var validators = {
    "borrowerNFT": "",
    "lenderNFT": "",
    "requestHs": "",
    "debtRequestHS": "",
    "collateralHS": "",
    "collateralHSOld": "",
    "interestHS": "",
    "liquidationHS": ""
  };
  return {
    type: "PlutusV1",
    script: toHex(encode(fromHex(validators[validatorName]))),
  };
}

const mintedAadaNftFromTx = async (transactionHash: String) : Promise<string> => {
  const transactionDetailsUtxos = await fetch(`/api/blockfrost/1/txs/${transactionHash}/utxos`).then((r) =>
      r.json())

  const aadaNFTInInput = [];
  for (let i = 0; i < transactionDetailsUtxos['inputs'].length; i++) {
    let inputs = transactionDetailsUtxos['inputs'][i];
    for (let io = 0; io < inputs['amount'].length; io++) {
      if (inputs['amount'][io]['unit'].includes('42f0e3706d2e0a0761db8da21387aadabe609a7cf328d249ebc2eeff') || inputs['amount'][io]['unit'].includes('21ca2902ad0406bc2ce361ad91157b3542544d86d4e3d3e3c43f1763')){
        aadaNFTInInput.push(inputs['amount'][io]['unit']);
      }
    }
  }
  for (let i = 0; i < transactionDetailsUtxos['outputs'].length; i++) {
    const output = transactionDetailsUtxos['outputs'][i];
    for (let io = 0; io < output['amount'].length; io++) {
      if (output['amount'][io]['unit'].includes('42f0e3706d2e0a0761db8da21387aadabe609a7cf328d249ebc2eeff') || output['amount'][io]['unit'].includes('21ca2902ad0406bc2ce361ad91157b3542544d86d4e3d3e3c43f1763')){
        if (!aadaNFTInInput.includes(output['amount'][io]['unit'])){
          var mintedNft = output['amount'][io]['unit'].replace("42f0e3706d2e0a0761db8da21387aadabe609a7cf328d249ebc2eeff", "").replace("21ca2902ad0406bc2ce361ad91157b3542544d86d4e3d3e3c43f1763", "");
        }
      }
    }
    }
  console.log("Minted NFT is", mintedNft);
  return mintedNft;
}

const mintTransactionFromAsset = async (assetClass: String) : Promise<string> => {
  const transactionDetailsUtxos = await fetch(`/api/blockfrost/1/assets/${assetClass}`).then((r) =>
      r.json())
  return transactionDetailsUtxos['initial_mint_tx_hash']
}

const aadaValidatorDatum = async (smartContractAddress: String, loanTxHash: String) => {
  var datumValues;
  const transactionDetailsUtxos = await fetch(`/api/blockfrost/1/txs/${loanTxHash}/utxos`).then((r) =>
      r.json())
  for (let i = 0; i < transactionDetailsUtxos['outputs'].length; i++) {
    const output = transactionDetailsUtxos['outputs'][i];
    if (output['address'] === smartContractAddress){
      const datumHash = output['data_hash']
      datumValues = await fetch(`/api/blockfrost/1/scripts/datum/${datumHash}`).then((r) =>
          r.json())
    }
  }
  return datumValues
}

const getUtxoIdInValidatorAddress = async (transactionHash: String, contractAddresses: String) : Promise<number> => {
  var outputIndex = 0;
  const transactionDetailsUtxos = await fetch(`/api/blockfrost/1/txs/${transactionHash}/utxos`).then((r) =>
      r.json())
  for (let i = 0; i < transactionDetailsUtxos['outputs'].length; i++) {
    const output = transactionDetailsUtxos['outputs'][i];
    if (output['address'] === contractAddresses){
      var outputIndex = Number(output['output_index']);
    }
  }
  return Number(outputIndex)
}


export {aadaValidator, mintedAadaNftFromTx, mintTransactionFromAsset, aadaValidatorDatum, getUtxoIdInValidatorAddress}